import ProtectedHeader from "../ProtectedHeader/ProtectedHeader";
import"./Movies.css";
import icon from "../../images/SearchIcon.png"

function Movies() {
    return (
    <div class="movies">
      <ProtectedHeader />
      <form>
        <input placeholder="Фильм" type="search" />
        <button type="submit"><img src={icon} ></img></button>
      </form>
    </div>
    );
  }
  
  export default Movies;
